export default function Home() {

    const myH2={
        color: "blue", 
        background: "black", 
        padding: "20px", 
        borderLeft:"5px solid red" }


    return (
        <div>
            <h1 style={{color: "red", background: "silver", padding: "10px", borderLeft:"5px solid black" } } > I'm Home Page, It's loaded Alhamdulillah </h1>

            <h2 style={myH2 } > I'm Home Page, It's loaded Alhamdulillah </h2>
        </div>
    )
}
